ющая линия','Line #'=>'Линия №','The number of search results has reached the limit of %s. Try refining your search.'=>'Число результатов поиска достигло предела в %s. Попробуйте уточнить критерии поиска.','No search results.'=>'Ничего не обнаружено.','Could not access file.'=>'Не удалось получить доступ к файлу.','Could not write to the temp directory. Try downloading files one at a time instead.'=>'Не удалось записать в директорию temp. Попробуйте загружать файлы по одному.','Could not access the specified files.'=>'Не удалось получить доступ к выбранным файлам.','Multiple files match this ID.'=>'Этому идентификатору соответствует несколько файлов.','Cleanup completed for %d order.'=>'Завершена очистка заказов (%d).' . "\0" . 'Завершена очистка заказов (%d).' . "\0" . 'Завершена очистка заказов (%d).','An error occurred while cleaning up order %1$d: %2$s'=>'В ходе очистки заказа %1$d возникла ошибка: %2$s','Cleanup completed for order %d.'=>'Завершена очистка заказов (%d).','Starting cleanup for %d order...'=>'Начата очистка заказов (%d)…' . "\0" . 'Начата очистка заказов (%d)…' . "\0" . 'Начата очистка заказов (%d)…','HPOS cleanup'=>'Очистка HPOS','No orders to cleanup.'=>'Нет заказов, подлежащих очистке.','Cleanup can only be performed when HPOS is active and compatibility mode is disabled.'=>'Очистка может быть выполнена, только если HPOS активен и режим совместимости отключён.','Failed to fetch AI responses for products.'=>'Не удалось получить ответы ИИ для товаров.','Failed to fetch AI responses.'=>'Не удалось получить ответы ИИ.','No images provided for generating AI content.'=>'Изображения созданные ИИ не предоставляются.','Error decoding JSON.'=>'Ошибка декодирования JSON.','No images found.'=>'Изображения не найдены.','AI Service is unavailable, try again later.'=>'Служба ИИ недоступна, повторите попытку позже.','Review your checkout experience'=>'Ознакомиться с опытом оформления заказа','The field %s is required.'=>'Поле %s является обязательным для запо