%7$s','⚠️ <b>️The Legacy REST API will be removed in WooCommerce 9.0.</b> <a target="_blank" href="%1$s">A separate WooCommerce extension is available</a> to keep it enabled. You can check Legacy REST API usages in <b><a target="_blank" href="%2$s">the WooCommerce log files</a></b> (file names start with <code>legacy_rest_api_usages</code>). <b><a target="_blank" href="%3$s">Learn more about this change.</a></b>'=>'⚠️ <b>️Устаревший API-интерфейс REST будет удалён из версии WooCommerce 9.0.</b>Чтобы его работа не нарушалась, <a target="_blank" href="%1$s">в WooCommerce появилось отдельное расширение</a>. Использование устаревшего API-интерфейса REST можно посмотреть в <b><a target="_blank" href="%2$s">файлах журнала WooCommerce</a></b> (имена файлов начинаются с <code>legacy_rest_api_usages</code>). <b><a target="_blank" href="%3$s">Подробнее об этом изменении.</a></b>','There was an error getting the install URL for this product.'=>'Произошла ошибка при получении URL установки для этого товара.','This product is already installed.'=>'Этот товар уже установлен.','You do not have permission to manage log entries.'=>'У вас нет прав на управление записями журнала.','Hide context'=>'Скрывать контекст','Show context'=>'Показывать контекст','Context'=>'Контекст','Additional context'=>'Дополнительный контекст','block descriptionEnable customers to filter the product collection by stock status.'=>'Возможность клиентам фильтровать коллекцию товаров по состоянию запасов.','block keywordfilter'=>'фильтр','block keywordstock'=>'запасы','block titleNo results'=>'Ничего не найдено','block descriptionThe contents of this block will display when there are no products found.'=>'Содержимое этого блока отображаются, если товары не найдены.','block keywordProduct Collection'=>'Коллекция товаров','This product will not trigger your customer\'s shipping calculator in cart or at checkout. This product also won\'t require your customers to enter their shipping details at checkout. <a href="https://woo.com/document/managing-products/#adding-a-virtual-product" target="_blank" rel="noreferrer">Read more about virtual products</a>.'=>'Этот товар не запустит калькулятор стоимости доставки до клиента в корзине или при оформлении заказа. Этот товар также не потребует от клиента вводить данные о доставке при оформлении заказа. <a href="https://woo.com/document/managing-products/#adding-a-virtual-product" target="_blank" rel="noreferrer">Подробнее о виртуальных товарах</a>.','This product has options, such as size or color. You can manage each variation\'s images, downloads, and other details individually.'=>'У этого товара есть опции, такие как размер или цвет. Можно управлять изображениями, загрузками и другими деталями каждой вариации по отдельности.','Buy button'=>'Кнопка покупки','Add a link and choose a label for the button linked to a product sold elsewhere.'=>'Добавьте ссылку и выберите ярлык кнопки, связанной с товаром, продаваемым в другом месте.','This variation will not trigger your customer\'s shipping calculator in cart or at checkout. This product also won\'t require your customers to enter their shipping details at checkout. <a href="https://woo.com/document/managing-products/#adding-a-virtual-product" target="_blank" rel="noreferrer">Read more about virtual products</a>.'=>'Эта вариация не запустит калькулятор доставки для клиента в корзине или при оформлении заказа. Этот товар также не потребует от клиента ввод адреса при оформлении заказа. <a href="https://woo.com/document/managing-products/#adding-a-virtual-product" target="_blank" rel="noreferrer">Подробности о виртуальных товарах</a>.','Link to the external product'=>'Ссылка на внешний товар','Enter the external URL to the product'=>'Введите внешний URL товара','Link to the external product is an invalid URL.'=>'Указан недопустимый URL внешнего товара.','Buy button text'=>'Текст кнопки покупки','Help customers find this product by assigning it to categories, adding extra details, and managing its visibility in your store and other channels.'=>'Помогите покупателям находить этот товар, поместив его в категорию, добавив подробные сведения и управляя его видимостью в вашем магазине и на внешних каналах.','Add descriptive pieces of information that customers can use to filter and search for this product. <a href="https://woo.com/document/managing-product-taxonomies/#product-attributes" target="_blank" rel="noreferrer">Learn more</a>.'=>'Добавьте описательные фрагменты информации, которые клиенты могут использовать для фильтрации и поиска этого товара. <a href="https://woo.com/document/managing-product-taxonomies/#product-attributes" target="_blank" rel="noreferrer">Узнать подробности</a>.','This product has options, such as size or color. You can now manage each variation\'s inventory and other details individually.'=>'У товара есть опции, такие как размер или цвет. Вы можете управлять запасами каждой вариации и другими деталями индивидуально.','This product has options, such as size or color. You can now manage each variation\'s shipping settings and other details individually.'=>'У товара есть опции, такие как размер или цвет. Вы можете управлять способами доставки каждой вариации и другими деталями индивидуально.','There\'s %d order pending sync. <b>Switching data storage while sync is incomplete is dangerous and can lead to order data corruption or loss!</b>'=>'Синхронизация %d заказа отложена. <b>Переключение хранилища данных во время незавершённой синхронизации опасно и может привести к повреждению или потере данных заказов!</b>' . "\0" . 'Синхронизация %d заказов отложена. <b>Переключение хранилища данных во время незавершённой синхронизации опасно и может привести к повреждению или потере данных заказов!</b>' . "\0" . 'Синхронизация %d заказов отложена. <b>Переключение хранилища данных во время незавершённой синхронизации опасно и может привести к повреждению или потере данных заказов!</b>','%1$s was called with an invalid event type "%2$s".'=>'%1$s был вызван с недопустимым типом события "%2$s".','Could not access the log file directory.'=>'Не удалось получить доступ к каталогу файла журнала.','This file does not exist.'=>'Такого файла не существует.','Filter by log source'=>'Фильтрация по источнику журнала','Date modified'=>'Дата изменения','File size'=>'Размер файла','Select the %1$s log file for %2$s'=>'Выбрать файл журнала %1$s для %2$s','No log files found.'=>'Файлы журнала не найдены.','Browse log files'=>'Просмотр файлов журнала','Return to the file list.'=>'Возврат к списку файлов.','Delete this log file permanently?'=>'Удалить этот файл журнала навсегда?','Viewing log file %s'=>'Просмотр файла журнала %s','File rotations:'=>'Ротация файлов:','Current'=>'Текущий','You do not have permission to manage log files.'=>'У вас нет прав на управление файлами журнала.','%s log file deleted.'=>'%s файл журнала удалён.' . "\0" . '%s файла журнала удалено.' . "\0" . '%s файлов журнала удалено.','Connect to Woo.com'=>'Подключиться к Woo.com','Caught exception while enqueuing action "%1$s": %2$s'=>'Перехваченное исключение при постановке в очередь действия "%1$s": %2$s','Patterns AI Data'=>'Данные шаблонов ИИ','Invalid business description.'=>'Некорректное описание компании.','The images for a given store.'=>'Изображения для данного хранилища.','Data generated by AI for updating dummy products.'=>'Данные, генерируемые ИИ для обновления демонстрационных товаров.','Product content not found.'=>'Содержимое карточки товара не найдено.','Customers will need to spend this amount to get free shipping.'=>'Клиенту нужно будет потратить указанную сумму, чтобы получить бесплатную доставку.','e.g. Local pickup'=>'например, местный самовывоз','WooCommerce Store Identifier.'=>'Идентификатор магазина WooCommerce.','Is store connected to Woo.com?'=>'Подключен ли сайт к Woo.com?','Attribute terms.'=>'Значения атрибута.','Charge a flat rate per item, or enter a cost formula to charge a percentage based cost or a minimum fee. Learn more about'=>'Взимайте фиксированную ставку за единицу товара или введите формулу стоимости, чтобы вычислять стоимость в процентах или брать минимальную комиссию. Узнать больше о','advanced costs'=>'дополнительных затратах','Your customers will see the name of this shipping method during checkout.'=>'Ваши клиенты увидят название этого способа доставки во время оформления заказа.','e.g. Standard national'=>'например, стандартный федеральный','These costs can optionally be added based on the <a target="_blank" href="%s">product shipping class</a>. Learn more about <a target="_blank" href="https://woo.com/document/flat-rate-shipping/#shipping-classes">setting shipping class costs</a>.'=>'Эти затраты могут быть дополнительно добавлены в зависимости от <a target="_blank" href="%s">класса доставки товара</a>. Узнать больше о <a target="_blank" href="https://woo.com/document/flat-rate-shipping/#shipping-classes">настройке стоимости класса доставки</a>.','Please enter a valid number'=>'Введите правильное число','e.g. Free shipping'=>'например, бесплатная доставка','A minimum order amount OR coupon'=>'Минимальная сумма заказа ИЛИ купон','A minimum order amount AND coupon'=>'Минимальная сумма заказа И купон','Free shipping requires'=>'Требования бесплатной доставки','No requirement'=>'Отсутствуют','Is your site connected to Woo.com?'=>'Подключен ли сайт к Woo.com?','Add to cart: &ldquo;%s&rdquo;'=>'Добавить в корзину &ldquo;%s&rdquo;','An optional zone you can use to set the shipping method(s) available to any regions that have not been listed above.'=>'Дополнительная зона, которую можно использовать для настройки способов доставки, доступных для любых регионов, которые не были перечислены выше.','A shipping zone consists of the region(s) you\'d like to ship to and the shipping method(s) offered. A shopper can only be matched to one zone, and we\'ll use their shipping address to show them the methods available in their area.'=>'Зона доставки состоит из регионов, в которые будут отправляться заказы, и предлагаемых способов доставки. Покупатель может быть привязан только к одной зоне, его адрес доставки будет использован для отображения ему способов, доступных в его регионе.','Classes'=>'Классы','Use shipping classes to customize the shipping rates for different groups of products, such as heavy items that require higher postage fees.'=>'Используйте классы доставки, чтобы настроить тарифы на доставку для различных групп товаров, таких как тяжелые или негабаритные товары, которые дороже доставлять.','Give your shipping class a name for easy identification'=>'Укажите название класса доставки для удобства идентификации','e.g. heavy-packages'=>'например, тяжёлые упаковки','e.g. Heavy'=>'например, тяжёлый','Slug (unique identifier) can be left blank and auto-generated, or you can enter one'=>'Ярлык (уникальный идентификатор) можно не указывать, чтобы он сгенерировался автоматически','e.g. For heavy items requiring higher postage'=>'например, для тяжёлых товаров, требующих более высоких расходов на логистику','Give your zone a name! E.g. Local, or Worldwide.'=>'Присвойте зоне название! Например, местная или глобальная.','List the regions you\'d like to include in your shipping zone. Customers will be matched against these regions.'=>'Перечислите регионы, которые нужно включить в зону доставки. Адреса клиентов будут сопоставляться с этими регионами.','Add the shipping methods you\'d like to make available to customers in this zone.'=>'Добавьте способы доставки, которые нужно сделать доступными для клиентов в этой зоне.','Set up %s'=>'Настроить "%s"','Add shipping class costs'=>'Добавьте стоимость класса доставки','STEP 2 OF 2'=>'Шаг 2 из 2','Create shipping method'=>'Создать способ доставки','STEP 1 OF 2'=>'Шаг 1 из 2','Add zone'=>'Добавить зону','Connected to Woo.com'=>'Подключен к Woo.com','Woo.com'=>'Woo.com','Woo.com Usage Tracking Documentation'=>'Документация по отслеживанию использования Woo.com','Subscription not found'=>'Подпи