irmation template serves as a receipt and confirmation of a successful purchase. It includes a summary of the ordered items, shipping, billing, and totals.'=>'Шаблон подтверждения заказа выполняет функцию квитанции и подтверждает успешное оформление покупки. Он включает в себя сводную информацию о заказанных товарах, доставке, выставления счёта и итоговых суммах.','Template namePage: Checkout'=>'Страница: Оформление заказа','Template namePage: Cart'=>'Страница: Корзина','The item type.'=>'Тип объекта.','You are not allowed to make this request. Please make sure you are logged in.'=>'Вам не разрешено отправлять такие запросы. Убедитесь, что вы вошли в систему.','The business description for a given store.'=>'Описание компании данного магазина.','Failed to update patterns content.'=>'Не удалось обновить содержимое шаблонов.','Failed to set the pattern content.'=>'Не удалось установить содержимое шаблона.','Failed to set the pattern images.'=>'Не удалось установить изображения шаблона.','The patterns dictionary is missing.'=>'Словарь шаблонов отсутствует.','The search term definition failed.'=>'Не удалось определить поисковый запрос.','Make sure cart and checkout flows are configured correctly for your shoppers.'=>'Убедитесь, что механизмы работы корзины и оформления заказа работают корректно при взаимодействии с покупателями.','Confirm email and view order'=>'Подтвердите адрес электронной почты и просмотрите заказ','Alternatively, confirm the email address linked to the order below.'=>'В качестве альтернативы, подтвердите адрес электронной почты, указанный в приведённом ниже заказе.','Have an account with us? %1$sLog in here%2$s to view your order.'=>'У вас есть учётная запись на нашем сайте? %1$sВойдите сюда%2$s, чтобы просмотреть детали заказа.','Great news! Your order has been received, and a confirmation will be sent to your email address.'=>'Отличные новости! Ваш заказ зарегистрирован, и на ваш адрес электронной почты будет отправлено подтверждение.','Have an account with us? %1$sLog in here to view your order details%2$s.'=>'У вас есть учётная запись на нашем сайте? %1$sВойдите сюда, чтобы просмотреть детали заказа%2$s.','If you\'ve just placed an order, give your email a quick check for the confirmation.'=>'Если вы только что разместили заказ, проверьте свой электронный почтовый ящик для его подтверждения.','Please check your email for the order confirmation.'=>'Пожалуйста, проверьте свою электронную почту для подтверждения заказа.','Try again'=>'Попробовать снова','Your order cannot be processed as the originating bank/merchant has declined your transaction. Please attempt your purchase again.'=>'Ваш заказ не может быть обработан, поскольку банк/продавец отклонил вашу транзакцию. Пожалуйста, повторите попытку опофрмления покупки.','Thank you. Your order has been fulfilled.'=>'Спасибо. Ваш заказ выполнен.','Your order was refunded %s.'=>'Ваш заказ был возвращён %s.','Your order has been cancelled.'=>'Ваш заказ был отменён.','AI content generation is not allowed on this store. Update your store settings if you wish to enable this feature.'=>'Генерирование контента с использованием ИИ в этом магазине запрещено. Обновите настройки своего магазина, если хотите включить эту функцию.','No business description provided for generating AI content.'=>'Для генерации текста ИИ не представлено описание компании.','Failed to fetch dummy products.'=>'Не удалось получить демонстрационные товары.','Placeholder image used to represent a product being showcased.'=>'Изображение-заполнитель, используемое для обозначения демонстрируемого товара.','Failed to retrieve the JWT token: Try again later.'=>'Не удалось получить токен JWT: повторите попытку позже.','Failed to fetch the site ID: The site is not registered.'=>'Не удалось получить ID сайта: сайт не зарегистрирован.','Failed to fetch the site ID: try again later.'=>'Не удалось получить ID сайта: повторите попытку позже.','Failed to connect with the AI endpoint: try again later.'=>'Не удалось подключиться к эндпойнту ИИ: повторите попытку позже.','Placeholder image used in the right column.'=>'Изображение-заполнитель, используемое в правом столбце.','Placeholder image used in the left column.'=>'Изображение-заполнитель, используемое в левом столбце.','Placeholder image used to represent products being showcased under the social media icons. 4 out of 4.'=>'Изображение-заполнитель, используемое для обозначения товара, демонстрируемого под значками соцсетей. 4 из 4.','Placeholder image used to represent products being showcased under the social media icons. 3 out of 4.'=>'Изображение-заполнитель, используемое для обозначения товара, демонстрируемого под значками соцсетей. 3 из 4.','Placeholder image used to represent products being showcased under the social media icons. 2 out of 4.'=>'Изображение-заполнитель, используемое для обозначения товара, демонстрируемого под значками соцсетей. 2 из 4.','Placeholder image used to represent products being showcased under the social media icons. 1 out of 4.'=>'Изображение-заполнитель, используемое для обозначения товара, демонстрируемого под значками соцсетей. 1 из 4.','Learn about new products and discounts'=>'Узнайте о новых товарах и скидках','Placeholder image used to represent a product being showcased in the featured products pattern. 4 out of 4.'=>'Изображение-заполнитель, используемое для обозначения товара, демонстрируемого в шаблоне списка рекомендуемых. 4 из 4.','Placeholder image used to represent a product being showcased in the featured products pattern. 3 out of 4.'=>'Изображение-заполнитель, используемое для обозначения товара, демонстрируемого в шаблоне списка рекомендуемых. 3 из 4.','Placeholder image used to represent a product being showcased in the featured products pattern. 2 out of 4.'=>'Изображение-заполнитель, используемое для обозначения товара, демонстрируемого в шаблоне списка рекомендуемых. 2 из 4.','Placeholder image used to represent a product being showcased in the featured products pattern. 1 out of 4.'=>'Изображение-заполнитель, используемое для обозначения товара, демонстрируемого в шаблоне списка рекомендуемых. 1 из 4.','Attribute term.'=>'Значение атрибута.','Limit result set to products with specified attributes.'=>'Ограничение списка товарами с определёнными атрибутами.','Default values for generated variations.'=>'Значения по умолчанию для сгенерированных вариаций.','Failed to generate the JWT token'=>'Не удалось сгенерировать токен JWT','Page where shoppers go to finalize their purchase'=>'Страница, на которую переходят покупатели, чтобы завершить оформление своей покупки','Page where shoppers review their shopping cart'=>'Страница, на которой покупатели просматривают товары, помещённые в корзину','Legacy'=>'Устаревшее','WooCommerce webhooks that use the Legacy REST API will be unsupported soon'=>'Вебзацепы WooCommerce, использующие устаревший REST API, скоро перестанут поддерживаться.','The WooCommerce Legacy REST API will be removed in WooCommerce 9.0, and this will cause <a href="%1$s">webhooks on this site that are configured to use the Legacy REST API</a> to stop working. <a target="_blank" href="%2$s">A separate WooCommerce extension is available</a> to allow these webhooks to keep using the Legacy REST API without interruption. You can also edit these webhooks to use the current REST API version to generate the payload instead. <b><a target="_blank" href="%3$s">Learn more about this change.</a></b>'=>'Устаревший API-интерфейс REST WooCommerce будет удалён из версии WooCommerce 9.0, и это может привести к тому, что <a href="%1$s">веб-перехватчики на этом сайте, настроенном на использование устаревшего API REST</a>, перестанут работать. <a target="_blank" href="%2$s">Вскоре появится отдельное расширение WooCommerce</a>, для того чтобы эти веб-перехватчики могли и дальше использовать устаревший API REST без перебоев. Вы также можете отредактировать эти веб-перехватчики, с тем чтобы они могли использовать текущую версию API REST д