 with redirects).'=>'Клиенты могут по-прежнему сохранить файл на своём устройстве, но по умолчанию файл будет открыт, а не загружен (не работает с переадресацией).','Summarize this product in 1-2 short sentences. We’ll show it at the top of the page.'=>'Опишите этот товар с помощью 1–2 коротких предложений. Это описание будет отображаться в верхней части страницы.','Are you sure you want to disconnect your store from Woo.com?'=>'Уверены, что хотите отключить свой магазин от Woo.com?','Your store is not connected to Woo.com. Run `wp wc com connect` command.'=>'Ваш магазин не подключен к Woo.com. Выполните команду "wp wc com connect".','Describe this product. What makes it unique? What are its most important features?'=>'Опишите этот товар. Что делает его уникальным? Каковы его наиболее важные особенности?','<b>Variable –</b> a product with variations, each of which may have a different SKU, price, stock option, etc. For example, a t-shirt available in different colors and/or sizes.'=>'<b>Вариативный —</b> товар с вариациями, каждая из которых может иметь свои артикул, цену, опции и т. д. Например, футболки могут быть разных цветов и/или размеров.','Product types define available product details and attributes, such as downloadable files and variations. They’re also used for analytics and inventory management.'=>'Типы товара определяют доступные особенности товара и атрибуты, например загружаемые файлы и вариации. Они также используются для аналитики и управления запасами.','<b>External or Affiliate –</b> one that you list and describe on your website but is sold elsewhere.'=>'<b>Внешний или аффилированный —</b> товар, который вы указываете и описываете на своём веб-сайте, но продаётся в другом месте.','<b>Grouped –</b> a collection of related products that can be purchased individually and only consist of simple products. For example, a set of six drinking glasses.'=>'<b>Сборный —</b> коллекция связанных товаров, которые можно приобрести по-отдельности и которые включат в себя только простые товары. Например, набор из шести стеклянных бокалов.','<b>Simple –</b> covers the vast majority of any products you may sell. Simple products are shipped and have no options. For example, a book.'=>'<b>Простой —</b> подходит для большинства товаров, которые можно продавать. Простые товары могут быть доставлены и не имеют опций. Например, книга.','Sofia District'=>'Sofia District','block titleBest Selling Products'=>'Самые продаваемые товары','block descriptionDisplay a grid of your all-time best selling products.'=>'Отображение сетки самых продаваемых товаров магазина за всё время.','block titleProduct Categories List'=>'Список категорий товаров','block descriptionShow all product categories as a list or dropdown.'=>'Отображение всех категорий товаров в виде выпадающего списка.','block titleProducts by Category'=>'Товары по категории','block descriptionDisplay a grid of products from your selected categories.'=>'Отображение сетки товаров из отмеченных категорий.','block titleAll Products'=>'Все товары','block descriptionDisplay products from your store in a grid layout.'=>'Отображение товаров магазина в виде сетки.','You cannot edit this item because it is in the Trash. Please restore it and try again.'=>'Невозможно изменить этот элемент, так как он находится в корзине. Восстановите его и повторите попытку.','This info will be displayed on the product page, category pages, social media, and search results.'=>'Эти данные будут показываться на странице товара, страницах рубрик, в социальных сетях и в результатах поиска.','Buy one of this item'=>'Купить один такой товар','Postcode / ZIP:'=>'Почтовый индекс:','City:'=>'Город:','Country / region:'=>'Страна/регион:','Thumbnail image'=>'Миниатюра','Can not re-use table alias "%s" in OrdersTableQuery.'=>'Невозможно использовать повторно псевдоним таблицы "%s" в OrdersTableQuery.','%s can not be used as a table alias in OrdersTableQuery'=>'Невозможно использовать "%s" в качестве псевдонима таблицы в OrdersTableQuery','List products and create ads on Facebook and Instagram.'=>'Публикуйте списки товаров и создавайте объявления в Facebook и Instagram.','You don\'t have permission to create a new order'=>'У вас нет прав на создание нового заказа','You do not have permission to edit this order'=>'У вас нет прав на редактирование этого заказа','You attempted to edit an order that does not exist. Perhaps it was deleted?'=>'Попытка изменить несуществующий заказ. Может быть, она удалена?','Key'=>'Ключ','Add Custom Field'=>'Добавить произвольное поле','Enter new'=>'Введите новое','Value'=>'Значение','Custom fields can be used to add extra metadata to an order that you can %1$suse in your theme%2$s.'=>'Произвольные поля позволяют добавлять к заказу метаданные, которые вы можете %1$sиспользовать в своей теме%2$s.','https://wordpress.org/support/article/custom-fields/'=>'https://wordpress.org/support/article/custom-fields/','Add New Custom Field:'=>'Добавить произвольное поле:','&mdash; Select &mdash;'=>'&mdash; Выбрать &mdash;','Custom Fields'=>'Произвольные поля','Invalid order IDs in call to read_multiple()'=>'Недопустимый ID заказа в вызове read_multiple()','Invalid table id: %s.'=>'Недопустимый id таблицы: %s.','With WooPayments, you can securely accept major cards, Apple Pay, and payments in over 100 currencies – with no setup costs or monthly fees – and you can now accept in-person payments with the Woo mobile app.'=>'Используя WooPayments, вы можете безопасно принимать карты основных платёжных систем, Apple Pay и оплату более чем в 100 валютах. Вам не потребуется платить за установку или ежемесячно оплачивать подписку. Кроме того, вы сможете принимать очные платежи с помощью мобильного приложения Woo.','With WooPayments, you can securely accept major cards, Apple Pay, and payments in over 100 currencies. Track cash flow and manage recurring revenue directly from your store’s dashboard - with no setup costs or monthly fees.'=>'Используя WooPayments, можно безопасно принимать оплату с карт основных платёжных систем и Apple Pay более чем в 100 валютах. Отслеживайте денежные потоки и управляйте регулярными поступлениями напрямую из панели администратора своего магазина. Платить за подключение и обслуживание не требуется.','List products and create ads on Facebook and Instagram with <a href="https://woo.com/products/facebook/">Facebook for WooCommerce</a>'=>'Публикуйте списки товаров и создавайте объявления в Facebook и Instagram с помощью плагина <a href="https://woo.com/products/facebook/">Facebook for WooCommerce</a>','Could not register file "%s" as a block pattern ("Slug" field missing)'=>'Не удалось зарегистрировать файл "%s" в качестве шаблона блока (не указан ярлык)','Could not register file "%1$s" as a block pattern (invalid slug "%2$s")'=>'Не удалось зарегистрировать файл "%1$s" в качестве шаблона блока (недопустимый ярлык "%2$s")','Could not register file "%s" as a block pattern ("Title" field missing)'=>'Не удалось зарегистрировать файл "%s" в качестве шаблона блока (не указан заголовок)','List of cross-sells items related to cart items.'=>'Список кросселов, связанных с товарами в корзине.','Displays a single product.'=>'Отображает один товар.','Displays your products.'=>'Отображает ваши товары.','Displays products filtered by a category.'=>'Отображает товары, отфильтрованные по категории.','Displays products filtered by a tag.'=>'Отображает товары, отфильтрованные по метке.','Displays search results for your store.'=>'Отображает результаты поиска товаров в пределах магазина.','Return the default payment suggestions when woocommerce_show_marketplace_suggestions and woocommerce_setting_payments_recommendations_hidden options are set to no'=>'Если для параметров woocommerce_show_marketplace_suggestions и woocommerce_setting_payments_recommendations_hidden задано значение "Нет", система возвращает рекомендации по оплате по умолчанию','Payment method is missing.'=>'Отсутствует способ оплаты.','Order status is missi