ust get started!'=>'%1$1sИзучите наши документы%2$2s для получения дополнительной информации или просто начните пользоваться!','Potentially unsecured files were found in your uploads directory'=>'В вашем каталоге загрузок обнаружены потенциально незащищённые файлы','Files that may contain %1$sstore analytics%2$s reports were found in your uploads directory - we recommend assessing and deleting any such files.'=>'В вашем каталоге загрузок обнаружены файлы, которые могут содержать отчёты %1$sаналитики магазина%2$s. Рекомендуем оперативно просматривать и удалять все подобные файлы.','We have created a sample draft Refund and Returns Policy page for you. Please have a look and update it to fit your store.'=>'Мы создали для вас образец страницы возврата. Пожалуйста, посмотрите и обновите его содержимое, чтобы оно соответствовало процессам вашей компании.','Edit page'=>'Редактировать страницу','%1$s at %2$s %3$s'=>'%1$s в %2$s %3$s','Page slugrefund_returns'=>'refund_returns','Page titleRefund and Returns Policy'=>'Политика возврата','Shipping Phone Number'=>'Номер телефона для доставки','When true, refunded items are restocked.'=>'Если подтверждено, возвращённые товары пополняются.','Net total revenue (formatted).'=>'Чистый общий доход (форматированный).','Extension\'s name - this will be used to ensure the data in the request is routed appropriately.'=>'Название расширения - будет использоваться для обеспечения правильной маршрутизации данных в запросе.','Additional data to pass to the extension'=>'Дополнительные данные для передачи расширению','Select a product to regenerate the data for, or leave empty for a full table regeneration:'=>'Выберите товар для регенерации данных или оставьте поле пустым для полной регенерации таблицы:','These settings are not available while the lookup table regeneration is in progress.'=>'Эти настройки недоступны во время регенерации таблицы обзора.','Enable table usage'=>'Включить использование таблицы','Use the product attributes looku