пользовать метод переадресации в крайнем случае. Смотрите <a href="%1$s">это руководство</a> для получения более подробной информации.','Allow using redirect mode (insecure) as a last resort'=>'Разрешить использовать режим переадресации (небезопасно) в крайнем случае','Set your store location and where you\'ll ship to.'=>'Укажите местоположение магазина и регионы доставки.','Choose payment providers and enable payment methods at checkout.'=>'Выберите платёжные системы и способы оплаты для оформления заказов.','You\'re only one step away from getting paid. Verify your business details to start managing transactions with WooPayments.'=>'Остался один шаг до начала приёма платежей. Проверьте сведения о вашей компании, чтобы начать управлять транзакциями с помощью WooPayments.','Start by adding the first product to your store. You can add your products manually, via CSV, or import them from another service.'=>'Для начала добавьте в магазин первый товар. Можно добавлять товары вручную, через CSV или импортировать их из другой службы.','Set your store location and configure tax rate settings.'=>'Укажите местоположение магазина и настройте ставку налога.','Good choice! You chose to add %1$s and %2$s to your store.'=>'Хороший выбор! Вы решили добавить %1$s и %2$s в магазин.','Grow your store'=>'Развивайте свой магазин','The rate at which tax is applied.'=>'Применяемая ставка налога.','Get backups'=>'Получить резервные копии','Store downtime means lost sales. One-click restores get you back online quickly if something goes wrong.'=>'Сбои в работе магазина приводят к потере прибыли. Восстановление одним щелчком позволяет быстро вернуться к работе, если что-то выходит из строя.','Protect your WooCommerce Store with Jetpack Backup.'=>'Защитите свой магазин WooCommerce с помощью Jetpack Backup.','Notes are unavailable because the "admin-note" data store cannot be loaded.'=>'Заметки недоступны, поскольку невозможно загрузить данные хранилища «admin-note».','Your store address is required to set the origin country for shipping, currencies, and payment options.'=>'Адрес магазина необходим, чтобы установить страну для настройки доставки, валюты и платежей.','Mollie'=>'Mollie','The Payfast extension for WooCommerce enables you to accept payments by Credit Card and EFT via one of South Africa’s most popular payment gateways. No setup fees or monthly subscription costs. Selecting this extension will configure your store to use South African rands as the selected currency.'=>'Расширение Payfast для WooCommerce позволяет принимать платежи по кредитной карте и путём безналичных переводов через один из самых популярных платёжных шлюзов в Южной Африке. Вам не потребуется платить за установку или ежемесячно оплачивать подписку. Если выбрать это расширение, в качестве валюты в магазине будет использоваться южноафриканский рэнд.','Variations Sold'=>'Вариантов продано','Number of product items sold.'=>'Количество проданных товаров.','Products sold'=>'Товаров продано','Source of note.'=>'Источник заметки.','Data store:'=>'Хранилище данных:','This section shows details of Action Scheduler.'=>'В этом разделе показаны сведения о планировщике действий.','Products by Rating list'=>'Товары по рейтинговому списку','Recently Viewed Products list'=>'Список недавно просмотренных товаров','Change status to cancelled'=>'Установить статус «отменён»','Download %d ID'=>'ID загрузки %d','Number of variation items sold.'=>'Количество проданных вариаций товара.','Things to do next'=>'Что делать дальше','Manage transactions without leaving your WordPress Dashboard. Only with WooPayments.'=>'Управляйте транзакциями, не выходя из панели инструментов WordPress. Только с WooPayments.','Create and send purchase follow-up emails, newsletters, and promotional campaigns straight from your dashboard.'=>'Создавайте и отправляйте электронные письма о покупке, новостные сообщения и рекламные кампании прямо в панели управления сайтом.','Product Category Link'=>'Ссылка категории товара','A link to a product category.'=>'Ссылка на категорию товара.','Product Tag Link'=>'Ссылка метки товара','A link to a product tag.'=>'Ссылка на метку товара.','Product Link'=>'Ссылка товара','A link to a product.'=>'Ссылка на товар.','How easy was it to add a product tag?'=>'Насколько легко было добавить метку товара?','To ensure your store&rsquo;s notifications arrive in your and your customers&rsquo; inboxes, we recommend connecting your email address to your domain and setting up a dedicated SMTP server. If something doesn&rsquo;t seem to be sending correctly, install the <a href="%1$s">WP Mail Logging Plugin</a> or check the <a href="%2$s">Email FAQ page</a>.'=>'Чтобы письма с уведомлениями магазина поступали вам и вашим клиентам, рекомендуем подключить адрес электронной почты к вашему домену и настроить выделенный SMTP-сервер. Если похоже, что сообщения не отправляются корректно, установите <a href="%1$s">плагин регистрации почты WP</a> или изучите <a href="%2$s">страницу часто задаваемых вопросов по электронной почте</а>.','Invalid path provided.'=>'Предоставлен неверный путь.','Anzoátegui'=>'Ансоатеги','Apure'=>'Апуре','Aragua'=>'Арагуа','Barinas'=>'Баринас','Bolívar'=>'Боливар','Carabobo'=>'Карабобо','Cojedes'=>'Кохедес','Falcón'=>'Фалькон','Guárico'=>'Гуарико','Lara'=>'Лара','Mérida'=>'Мерида','Miranda'=>'Миранда','Monagas'=>'Монагас','Nueva Esparta'=>'Нуэва-Эспарта','Portuguesa'=>'Португеса','Sucre'=>'Сукре','Táchira'=>'Тачира','Trujillo'=>'Трухильо','Yaracuy'=>'Яракуй','Zulia'=>'Сулия','Federal Dependencies'=>'Федеральные владения','Delta Amacuro'=>'Дельта-Амакуро','Capital'=>'Столичный округ','Filling in progress (%d)'=>'Заполнение в процессе (%d)','Regenerate the product attributes lookup table'=>'Регенерировать таблицу обзора атрибутов товара','Product attributes lookup table data is regenerating'=>'Данные таблицы обзора атрибутов товара регенерируются','This tool will regenerate the product attributes lookup table data from existing product(s) data. This process may take a while.'=>'Этот механизм регенерирует данные таблицы обзора атрибутов товара из данных существующих товаров. Данный процесс может занять некоторое время.','Accept credit and debit cards, offline (cash or bank transfer) and logged-in payments with money in Mercado Pago. Safe and secure payments with the leading payment processor in LATAM.'=>'Принимайте кредитные и дебетовые карты, офлайн (наличными или банковским переводом) и деньгами при авторизации в Mercado Pago. Безопасные и надёжные платежи с ведущим платежным процессором в Латинской Америке.','Paystack'=>'Paystack','Paystack helps African merchants accept one-time and recurring payments online with a modern, safe, and secure payment gateway.'=>'Paystack помогает африканским торговцам принимать разовые и повторяющиеся платежи с помощью современного безопасного платежного шлюза.','Mercado Pago Checkout Pro & Custom'=>'Mercado Pago Checkout Pro и Custom','MailPoet'=>'MailPoet','How easy was it to use search?'=>'Насколько легко было использовать поиск?','How easy was it to add product category?'=>'Насколько легко было добавить категорию товаров?','How easy was it to add a product attribute?'=>'Насколько легко было добавить атрибут товаров?','%s connected successfully'=>'%s подключен успешно','Hi there,'=>'Привет,','Nice one; you\'ve created a WooCommerce store! Now it\'s time to add your first product and get ready to start selling.%s'=>'Симпатяга; вы создали магазин WooCommerce! Пришло время добавить свой первый товар и приготовиться к продажам.%s','Enable PayU’s exclusive plugin for WooCommerce to start accepting payments in 100+ payment methods available in India including credit cards, debit cards, UPI, & more!'=>'Включите эксклюзивный плагин PayU для WooCommerce, чтобы начать принимать платежи более чем 100 способами оплаты, доступными в вашей стране, включая кредитные карты, дебетовые карты, UPI и многое другое!','%s (optional)'=>'%s (необязательно)','Add tax rates'=>'Добавить налоговые ставки','Get ready to start selling'=>'Будьте готовы к началу продаж','PayU for WooCommerce'=>'PayU для WooCommerce','Integration registry requires an identifier.'=>'Реестр интеграции требует идентификатора.','"%s" is already registered.'=>'«%s» уже зарегистрирован.','Integration "%s" is not registered.'=>'Интеграция «%s» не зарегистрирована.','There are too many %s in the cart. Only 1 can be purchased. Please reduce the quantity in your cart.'=>'В корзине слишком много %s. пожалуйста уменьшите количество в корзине до 1.','There are too many %s in the cart. Only 1 of each can be purchased. Please reduce the quantities in your cart.'=>'В корзине слишком много %s. пожалуйста уменьшите количество каждого товара в корзине до 1.','There is not enough %s in stock. Please reduce the quantity in your cart.'=>'%s заканчивается на складе. Уменьшите количество в вашей корзине.','There are not enough %s in stock. Please reduce the quantities in your cart.'=>'%s заканчиваются на складе. Уменьшите количество в вашей корзине.','There was an error with an item in your cart.'=>'Произошла ошибка с товаром в вашей корзине.','%1$s and %2$s'=>'%1$s и %2$s','Block name is required.'=>'Требуется название блока.','%s are out of stock and cannot be purchased. Please remove them from your cart.'=>'%s отсутствуют и не могут быть приобретены. Пожалуйста, удалите их из корзины.','%s cannot be purchased. Please remove it from your cart.'=>'%s невозможно приобрести. Пожалуйста, удалите его из вашей корзины.','%s is out of stock and cannot be purchased. Please remove it from your cart.'=>'%s отсутствует на складе и не может быть приобретён. Пожалуйста, удалите его из корзины.','%s cannot be purchased. Please remove them from your cart.'=>'%s невозможно приобрести. Пожалуйста, удалите их из своей корзины.','List of postcodes / ZIPs. Introduced in WooCommerce 5.3.'=>'Список почтовых индексов. Представлен в WooCommerce 5.3.','List of city names. Introduced in WooCommerce 5.3.'=>'Список городов. Представлен в WooCommerce 5.3.','City name, it doesn\'t support multiple values. Deprecated as of WooCommerce 5.3, \'cities\' should be used instead.'=>'Название города не предполагает несколько значений. Это осталось в прошлом с выпуском WooCommerce 5.3, вместо него следует использовать «города».','Postcode/ZIP, it doesn\'t support multiple values. Deprecated as of WooCommerce 5.3, \'postcodes\' should be used instead.'=>'Почтовый индекс/ZIP не предполагает поддержку нескольких значений. Это устарело с выпуском WooCommerce 5.3, вместо этого следует использовать «почтовые индексы».','Search for a page&hellip;'=>'Искать страницу&hellip;','Adds the new WooCommerce settings UI.'=>'Добавлен новый интерфейс настроек WooCommerce.','Favorite already exists'=>'Закладка уже существует','Favorite item not found'=>'Закладка не найдена','Invalid user_id provided'=>'Предоставлен неверный user_id','Offset the result set by a specific number of items. Applies to hierarchical taxonomies only.'=>'Смещение набора результатов на определенное количество элементов. Применяется только к иерархической таксономии.','Limit result set to resources assigned to a specific parent. Applies to hierarchical taxonomies only.'=>'Ограничьте набор результатов ресурсами, назначенными определённому родителю. Применяется только к иерархической таксономии.','WooCommerce Setup'=>'Настройка WooCommerce','Step'=>'Шаг','of'=>'из','You\'re almost there! Once you complete store setup you can start receiving orders.'=>'Вы почти там! После завершения настройки магазина вы сможете начать получать заказы.','Start selling'=>'Начать продавать','When variation stock reaches this amount you will be notified by email. The default value for all variations can be set in the product Inventory tab. The shop default value can be set in Settings > Products > Inventory.'=>'Когда запас вариации товара достигнет этого количества, вы получите уведомление по электронной почте. Стандартное значение для всех вариаций можно установить на вк