тво отзывов на товары в этой категории.','Returns number of products within attribute terms.'=>'Выдаёт количество товаров в пределах атрибутов.','Apartment, suite, etc.'=>'Крыло, этаж и т.д.','List of available shipping rates for the cart.'=>'Список доступных тарифов доставки для этой корзины.','List of cart items the returned shipping rates apply to.'=>'Список товаров в корзине, к которым применяются тарифы доставки.','List of shipping rates.'=>'Список тарифов доставки.','Name of the shipping rate, e.g. Express shipping.'=>'Название тарифа доставки, например "Быстрая доставка".','Price of this shipping rate using the smallest unit of the currency.'=>'Цена по этому тарифу доставки, указанная в самой мелкой денежной единице.','Status of the payment returned by the gateway. One of success, pending, failure, error.'=>'Статус платежа, возвращаемого шлюзом. Один из вариантов: успешно, в ожидании, сбой, ошибка.','Country/Region code in ISO 3166-1 alpha-2 format.'=>'Код страны/региона в формате ISO 3166-1 alpha-2.','A URL to redirect the customer after checkout. This could be, for example, a link to the payment processors website.'=>'URL для переадресации клиентов после оформления заказа. Например, это может быть ссылка на веб-сайт платёжной системы.','Current set shipping address for the customer.'=>'Заданный адрес доставки клиента.','Total price the customer will pay.'=>'Итоговая сумма, которую заплатит клиент.','Name of the item.'=>'Название товара.','Lines of taxes applied to items and shipping.'=>'Действие налогов распространяется на товары и доставку.','List of cart item errors, for example, items in the cart which are out of stock.'=>'Список ошибок товаров в корзине, например, тех, что нет в наличии.','Total amounts provided using the smallest unit of the currency.'=>'Итоговая сумма, указанная в самой мелкой денежной единице.','Total discount applied by this coupon.'=>'Итоговая сумма скидки купона.','Total tax removed due to discount applied by this coupon.'=>'Итого