rough to the payment method when processing payment.'=>'Данные, необходимые службе оплаты для обработки платежа.','Limit result set to products based on a maximum price, provided using the smallest unit of the currency.'=>'Ограничить результаты товарами на основе максимальной цены, указанной с использованием самых мелких денежных единиц.','Invalid coupon code.'=>'Неверный код купона.','Limit result set to reviews from specific product IDs.'=>'Ограничение результатов отзывами о товарах с конкретными ID.','Limit result set to reviews from specific category IDs.'=>'Ограничение результатов отзывами о товарах в конкретных категориях.','Sort ascending or descending.'=>'Сортировка по возрастанию или убыванию.','Product short description in HTML format.'=>'Краткое описание товара в формате HTML.','Note added to the order by the customer during checkout.'=>'Примечание, добавленное клиентом к заказу в процессе его оформления.','Unique identifier (key) for the cart item.'=>'Уникальный идентификатор (ключ) товара в корзине.','Unique identifier (key) for the cart item to update.'=>'Уникальный идентификатор (ключ) для обновления товара в корзине.','New quantity of the item in the cart.'=>'Новое количество товаров в корзине.','Quantity left in stock if stock is low, or null if not applicable.'=>'Количество товара в наличии, если запас на исходе, или ноль, если неприменимо.','"%s" is an invalid coupon code.'=>'«%s» является недействительным кодом купона.','Coupon code "%s" has already been applied.'=>'Код купона «%s» уже применён.','"%s" has already been applied and cannot be used in conjunction with other coupons.'=>'«%s» уже применён и не может использоваться вместе с другими купонами.','&quot;%s&quot; is not available for purchase.'=>'«%s» невозможно оформить для покупки.','Invalid coupons were removed from the cart: "%s"'=>'Недействительные купоны удалены из корзины: «%s».','Cart item is invalid.'=>'В корзине находится недопустимый товар.','Cart item no longer exists or is invalid.'=>'Товара в корзине больше не существует или он недействительный.','The chosen rate ID for the package.'=>'ID выбранного для пакета тарифа.','Method not implemented'=>'Метод не применён','ID of the parent product, if applicable.'=>'ID родительского товара, если есть.','Parent term ID, if applicable.'=>'ID родительского условия, если применимо.','The order ID to process during checkout.'=>'ID заказа для обработки во время оформления заказа.','Customer ID if registered. Will return 0 for guests.'=>'ID клиента, если он зарегистрирован. Будет равен 0 для гостей.','The %s payment gateway is not available.'=>'Платежный шлюз %s недоступен.','List of variation IDs, if applicable.'=>'Список ID вариации, если есть.','Database verified successfully.'=>'База данных проверена.','Verify base database tables'=>'Проверить основные таблицы базы данных','This tool will empty the template cache.'=>'Этот инструмент позволяет очистить кэш шаблона.','Verify database'=>'Проверить базу данных','Verify if all base database tables are present.'=>'Проверить наличие всех основных таблиц базы данных.','Template cache cleared.'=>'Кэш шаблона очищен.','The active version of WooCommerce does not support template cache clearing.'=>'Активная версия WooCommerce не поддерживает очистку кэша шаблона.','You need WooCommerce 4.2 or newer to run this tool.'=>'Чтобы запустить этот инструмент, необходимо решение WooCommerce 4.2 или более новой версии.','Clear template cache'=>'Очистить кэш шаблона','Collect and validate EU VAT numbers at checkout'=>'Собирать и проверять номера плательщиков НДС (ЕС) при оформлении заказа','WooCommerce %1$s table creation failed. Does the %2$s user have CREATE privileges on the %3$s database?'=>'Сбой создания таблицы %1$s WooCommerce. Есть ли у пользователя %2$s права на СОЗДАНИЕ в базе данных %3$s?','If your store is based in the EU, we recommend using the EU VAT Number extension in addition to automated taxes. It provides your checkout with a field to collect and validate a customer\'s EU VAT number, if they have one.'=>'Если ваш магазин находится на территории ЕС, рекомендуем помимо автоматических налогов использовать расширение "Номер плательщика НДС (ЕС)". Благодаря нему на странице оформления заказа появляется поле, которое позволяет собирать и проверять номер плательщика НДС в ЕС, если такой есть у клиента.','Get real-time order alerts anywhere'=>'Получайте уведомления о новых заказах в реальном времени, где бы вы ни находились','Remove legacy coupon menu'=>'Удалить устаревшее меню купонов','First order received'=>'Получен первый заказ','Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.'=>'Получайте уведомления об активности в магазине, в том числе о размещении новых заказов и отзывов о товарах, прямо на мобильные устройства благодаря приложению Woo.','Coupons can now be managed from Marketing > Coupons. Click the button below to remove the legacy WooCommerce > Coupons menu item.'=>'Теперь управление купонами производится в разделе Маркетинг > Купоны. Нажмите кнопку ниже, чтобы удалить устаревший элемент меню WooCommerce > Купоны.','Maximum number of items to be returned in result set. Defaults to no limit if left blank.'=>'Максимальное количество элементов, возвращаемых в результирующем наборе. При пустом поле ограничения отсутствуют.','Verifying database... One or more tables are still missing: '=>'Проверка базы данных... Одна или несколько таблиц по-прежнему отсутствуют: ','Invalid category ID.'=>'Недопустимый ID категории.','The admin note layout has a wrong prop value.'=>'Макет примечания администратора включает неверное значение свойства.','Do you need help with adding your first product?'=>'Нужна помощь с добавлением первого товара?','Starting a fashion website is exciting but it may seem overwhelming as well. In this article, we\'ll walk you through the setup process, teach you to create successful product listings, and show you how to market to your ideal audience.'=>'Запускать веб-сайт о моде интересно, но требует много сил. В этой статье мы поможем вам преодолеть процесс настройки шаг за шагом, научим создавать списки товаров и покажем, как привлечь нужных посетителей.','Start your online clothing store'=>'Запустите свой магазин одежды','This video tutorial will help you go through the process of adding your first product in WooCommerce.'=>'Это обучающее видео поможет вам добавить в WooCommerce первый товар.','Coupon management has moved!'=>'Управление купонами теперь в новом месте!','Now that you’ve chosen us as a partner, our goal is to make sure we\'re providing the right tools to meet your needs. We\'re looking forward to having your feedback on the store setup experience so we can improve it in the future.'=>'Теперь, когда мы стали вашим партнером, мы постараемся обеспечить вас всеми необходимыми инструментами. Ждем ваш отзыв о процессе настройки магазина. Он поможет нам оптимизировать его в будущем.','Watch tutorial'=>'Смотреть видео','Share feedback'=>'Поделится отзывом','Changing eCommerce platforms might seem like a big hurdle to overcome, but it is easier than you might think to move your products, customers, and orders to WooCommerce. This article will help you with going through this process.'=>'Изменение платформы eCommerce может показаться непреодолимым препятствием, но на самом деле перенести товары, клиентов и заказы на WooCommerce не так уж сложно. Эта статья поможет вам все сделать правильно.','Do you want to migrate from Shopify to WooCommerce?'=>'Хотите перейти с Shopify на WooCommerce?','WooCommerce Subscriptions allows you to introduce a variety of subscriptions for physical or virtual products and services. Create product-of-the-month clubs, weekly service subscriptions or even yearly software billing packages. Add sign-up fees, offer free trials, or set expiration periods.'=>'Подписки WooCommerce позволяют предлагать различные подписки на физические и виртуальные товары и