ed downloads data.'=>'Данные об оплаченных загрузках пользователя WooCommerce.','User&#8217;s WooCommerce orders data.'=>'Данные о заказах пользователя WooCommerce.','User&#8217;s WooCommerce customer data.'=>'Клиентские данные пользователя WooCommerce.','Maputo Province'=>'Мапуту, провинция','Niassa'=>'Ниасса','%s() was called before the Action Scheduler data store was initialized'=>'%s() был вызван перед тем, как было инициализировано хранилище данных Action Scheduler','Your store\'s uploads directory is <a href="%1$s">browsable via the web</a>. We strongly recommend <a href="%2$s">configuring your web server to prevent directory indexing</a>.'=>'Каталог загрузок магазина <a href="%1$s">открыт для просмотра в Интернете</a>. Мы настоятельно рекомендуем <a href="%2$s">настроить на веб-сервере блокировку индексации каталога</a>.','Finish setup'=>'Завершить настройку','Take payments via bank transfer.'=>'Принимайте оплату банковским переводом.','Take payments in cash upon delivery.'=>'Принимайте оплату наличными при доставке.','Payfast'=>'Payfast','Installed version not tested with active version of WooCommerce %s'=>'Установленная версия не тестировалась с действующей версией WooCommerce %s','%1$s (update to version %2$s is available)'=>'%1$s (доступно обновление до версии %2$s)','If checked, free shipping would be available based on pre-discount order amount.'=>'Если галочка установлена, может быть доступна бесплатная доставка при определенной сумме заказа без учета скидки.','Apply minimum order rule before coupon discount'=>'Применить правило минимальной суммы заказа без учета скидки','Coupons discounts'=>'Скидки купонов','Please visit the <a href="%s" target="_blank">subscriptions page</a> and renew to continue receiving updates.'=>'Посетите <a href="%s" target="_blank">страницу подписок</a> и продлите свою подписку, чтобы получать обновления.','For further assistance with WooCommerce core, use the <a href="%1$s">community forum</a>. For help with premium extensions sold on Woo.com, <a href="%2$s">open a support request at Woo.com</a>.'=>'Дополнительную помощь по использованию основных возможностей WooCommerce можно получить в <a href="%1$s">форуме сообщества</a>. Если вам нужна помощь по работе с премиум-расширениями Woo.com, <a href="%2$s">отправьте запрос в службу поддержки на Woo.com</a>.','Visit Woo.com to learn more about <a href="%1$s" target="_blank">getting started</a>.'=>'Посетите Woo.com, чтобы узнать о том, с чего <a href="%1$s" target="_blank">начать работу</a>.','Name of other platform used to sell (not listed).'=>'Название платформы, используемой для продажи (нет в списке).','The plugin could not be activated.'=>'Не удалось активировать плагин.','Personalize homepage'=>'Настройте главную страницу','Personalize your store\'s homepage'=>'Настройте главную страницу магазина','Limit stats fields to the specified items.'=>'Ограничьте поля статистики определёнными товарами.','Shipping Label'=>'Транспортная этикетка','The homepage is one of the most important entry points in your store. When done right it can lead to higher conversions and engagement. Don\'t forget to personalize the homepage that we created for your store during the onboarding.'=>'Страница обзора — один из самых важных разделов вашего магазина. Правильная настройка может помочь повысить конверсию и интерес посетителей. Не забывайте о возможности редактировать страницу, которую мы создали для вашего магазина в процессе адаптации.','There was an error communicating with the WooPayments plugin.'=>'Произошла ошибка при обмене данными с плагином WooPayments.','Securely accept credit and debit cards on your site. Manage transactions without leaving your WordPress dashboard. Only with <strong>WooPayments</strong>.'=>'Безопасно принимайте кредитные и дебетовые карты на своем сайте. Управляйте транзакциями, не выходя из панели управления WordPress. Только с <strong>WooPayments</strong>.','Try the new way to get paid'=>'Попробуйте новый способ приёма платежей','It appears one or more database tables were missing. Attempting to re-create the missing table(s).'=>'Кажется, отсутствует одна или несколько таблиц баз данных. Пытаемся восстановить отсутствующие таблицы.','Your store is configured to serve digital products using "Redirect only" method. This method is deprecated, <a href="%s">please switch to a different method instead.</a><br><em>If you use a remote server for downloadable files (such as Google Drive, Dropbox, Amazon S3), you may optionally wish to "allow using redirects as a last resort". Enabling that and/or selecting any of the other options will make this notice go away.</em>'=>'Ваш магазин настроен для размещения цифровых товаров методом «только переадресация». Этот метод устарел, <a href="%s">вам необходимо переключиться на другой метод</a>.<br><em>Если вы используете отдалённый сервер для загрузки файлов (например, Google Диск, Dropbox, Amazon S3), при желании вы можете «разрешить использование переадресации в крайнем случае». При включении этого параметра и/или выборе любого другого параметра это уведомление исчезнет.</em>','There was an error connecting to Woo.com. Please try again.'=>'Произошла ошибка при подключении к Woo.com. Повторите попытку.','Get started'=>'Приступить','Choose theme'=>'Выбор темы','Send targeted campaigns, recover abandoned carts and much more with Mailchimp.'=>'Mailchimp позволяет рассылать нацеленные кампании, восстанавливать оставленные корзины покупок и многое другое.','Set up payments'=>'Настройка платежей','Set up shipping'=>'Настроить доставку','Securely accept credit and debit cards with one low rate, no surprise fees (custom rates available). Sell online and in store and track sales and inventory in one place.'=>'Безопасно принимайте кредитные и дебетовые карты с единой низкой ставкой, без неожиданных комиссионных сборов (доступны настраиваемые ставки). Продавайте онлайн и в магазине. Отслеживайте продажи и складские запасы в одной точке.','Choose the payment that you want, pay now, pay later or slice it. No credit card numbers, no passwords, no worries.'=>'Выберите необходимый платёж. Оплатите сразу, позже или по частям. Ни номеров кредитных карт, ни паролей, ни других проблем.','Accept debit and credit cards in 135+ currencies, methods such as Alipay, and one-touch checkout with Apple Pay.'=>'Принимайте дебетовые и кредитные карты, поддерживая свыше 135 иностранных валют и разные методы оплаты, например Alipay, и оформляйте заказ одним касанием с помощью Apple Pay.','Store connected successfully.'=>'Магазин успешно подключен.','Purchase & install now'=>'Купить и установить сейчас','Average order value'=>'Средняя стоимость заказа','Customer type'=>'Тип клиента','Gross sales'=>'Валовый доход','CBD and other hemp-derived products'=>'Каннабидиол и другие производные конопли','Action that should be completed to connect Jetpack.'=>'Действие, которое необходимо выполнить для подключения Jetpack.','Plugin status.'=>'Статус плагина.','Plugin name.'=>'Название плагина.','Plugin slug.'=>'Строка плагина.','There was an error connecting to Square.'=>'Произошла ошибка при подключении Square.','IP address.'=>'IP-адрес.','A partial IP address can be passed and matching results will be returned.'=>'Можно передать частичный IP-адрес, и будут возвращены соответствующие результаты.','Invalid request. Please pass the match parameter.'=>'Запрос недействителен. Передайте параметр соответствия.','Task List'=>'Список задач','Disable'=>'Отключение','Profile Setup Wizard'=>'Мастер настройки профиля','WooCommerce Onboarding'=>'WooCommerce Onboarding','Bookings'=>'Бронирование','Memberships'=>'Тарифные планы','Home, furniture, and garden'=>'Дом, мебель и сад','Food and drink'=>'Еда и напитки','Electronics and computers'=>'Электроника и компьютеры','Health and beauty'=>'Здоровье и красота','Fashion, apparel, and accessories'=>'Мода, одежда и аксессуары','Analytics'=>'Аналитика','[deleted]'=>'[Удалено]','Edit Coupon'=>'Изменить купон','Edit Order'=>'Изменить з