 кодировании в формате JSON.','The next queue will begin processing in approximately %d seconds.'=>'Обработка следующей очереди начнется примерно через %d сек.','Action [%1$s] has an invalid schedule: %2$s'=>'Для действия [%1$s] установлено недопустимое расписание: %2$s','Settings for WooCommerce admin reporting.'=>'Настройки для отчетов администратора WooCommerce.','Excluded report order statuses'=>'Исключённые статусы заказа отчёта','A new queue has begun processing. <a href="%s">View actions in-progress &raquo;</a>'=>'Началась обработка новой очереди. <a href="%s">Посмотреть выполняемые действия &raquo;</a>','%1$s &lsaquo; %2$s'=>'%1$s &lsaquo; %2$s','Stopped the insanity for %d second'=>'Ограничение на %d секунду' . "\0" . 'Ограничение на %d секунды' . "\0" . 'Ограничение на %d секунд','The date/time the action is/was scheduled to run.'=>'Дата/время, когда было запланировано выполнение этого действия.','Scheduled'=>'Запланировано','The action\'s schedule frequency.'=>'Периодичность выполнения действия.','Optional action group.'=>'Необязательная группа действий.','Scheduled Action Columns'=>'Столбцы запланированных действий','Action statuses are Pending, Complete, Canceled, Failed'=>'Статусы действий: В ожидании, Завершено, Отменено, Не выполнено','Action Scheduler is a scalable, traceable job queue for background processing large sets of actions. Action Scheduler works by triggering an action hook to run at some time in the future. Scheduled actions can also be scheduled to run on a recurring schedule.'=>'Планировщик действий — это масштабируемая отслеживаемая очередь заданий для фоновой обработки больших наборов действий. Планировщик действий работает, вызывая ловушку действия для запуска в определенный момент в будущем. Запланированные действия также могут быть запланированы для выполнения по регулярному расписанию.','Name of the action hook that will be triggered.'=>'Название ловушки действия, которая будет запущена.','Optional data array passed to the action hook.'=>'Необязательный массив данных передается в ловушку действия.','About'=>'О нас','Migrating %d action'=>'Перенос действия %d' . "\0" . 'Перенос действий %d' . "\0" . 'Перенос действий %d','Action Scheduler migration in progress. The list of scheduled actions may be incomplete.'=>'Выполняется перенос по расписанию планировщика действий. Список запланированных действий может быть неполным.','Unable to remove source migrated action %s'=>'Невозможно удалить исходное перенесенное действие %s','About Action Scheduler %s'=>'О планировщике действий %s','Migrated action with ID %1$d in %2$s to ID %3$d in %4$s'=>'Действие перемещения с ID %1$d в %2$s в ID %3$d в %4$s','Version:'=>'Версия:','Invalid action - must be a recurring action.'=>'Неверное действие — должно быть повторяющимся действием.','Destination store must be configured before running a migration'=>'Целевое хранилище должно быть настроено перед запуском переноса','Source store must be configured before running a migration'=>'Исходное хранилище должно быть настроено перед запуском переноса','This data will be deleted in %s.'=>'Эти данные будут удалены в %s.','MaxMind Geolocation'=>'Геолокация MaxMind','Append a unique string to filename for security'=>'Добавить уникальную строку в имя файла для повышения уровня безопасности','Unable to detect the Action Scheduler package.'=>'Не удалось обнаружить пакет планировщика действий.','Action Scheduler package running on your site.'=>'Пакет планировщика действий уже работает на вашем сайте.','Action Scheduler package'=>'Пакет планировщика действий','Unable to detect the Blocks package.'=>'Не удалось обнаружить пакет Blocks.','The WooCommerce Blocks package running on your site.'=>'Пакет WooCommerce Blocks уже работает на вашем сайте.','WooCommerce Blocks package'=>'Пакет WooCommerce Blocks','Coupon(s):'=>'Купоны:','Filename'=>'Название файла','Redirect only (Insecure)'=>'Только редирект (небезопасно)','If you are using X-Accel-Redirect download method along with NGIN