ается получить сведения о базе данных. Обычно это не проблема, и это означает, что ваша установка использует класс, который заменяет класс базы данных WordPress (например, HyperDB), и WooCommerce не может получить доступ к информацию о базе данных.','Drag and drop to set admin attribute order'=>'Меняйте порядок атрибутов администратора методом перетаскивания','Zero rate'=>'Нулевая ставка','Reduced rate'=>'Пониженная ставка','Thanks for using {site_url}!'=>'Мы рады, что вы используете {site_url}!','Congratulations on the sale.'=>'Поздравляем вас с продажей.','Town / Village'=>'Город / Село','Postal code'=>'Почтовый индекс','Invalid field'=>'Неверное поле','Tax class slug already exists'=>'Ярлык налогового класса уже существует','Tax class requires a valid name'=>'Налоговый класс нуждается в корректном названии','Additional content'=>'Дополнительное содержимое','Or you can download a pre-built version of the plugin from the <a href="%1$s">WordPress.org repository</a> or by visiting <a href="%2$s">the releases page in the GitHub repository</a>.'=>'Либо вы можете скачать уже собранную версию плагина из <a href="%1$s">репозитория WordPress.org</a> или со <a href="%2$s"> страницы релизов в репозитории GitHub</a>.','Text to appear below the main email content.'=>'Текст, который будет отображаться под основным содержимым сообщения.','You do not have permission to install plugins.'=>'У вас нет разрешения на установку плагинов.','The Rest API is unavailable.'=>'Rest API недоступен.','Order not editable'=>'Заказ нередактируем','The sale will start at 00:00:00 of "From" date and end at 23:59:59 of "To" date.'=>'Распродажа стартует в 00:00:00 в день "С..." и завершится в 23:59:59 в день "По...".','Learn how to upgrade'=>'Узнайте как произвести обновление','Order fully refunded.'=>'Заказ полностью возвращен.','Selecting no country / region to sell to prevents from completing the checkout. Continue anyway?'=>'Без указания страны/региона продаж невозможно завершить процесс оформлен