о, эти шаблоны потребуется обновить, чтобы обеспечить совместимость с текущей версией WooCommerce. Предлагаем выполнить следующее:','WooCommerce Services icon'=>'Значок WooCommerce Services','If you\'d like to offer <span class="help_tip" data-tip="%1$s">live rates</span> from a specific carrier (e.g. UPS) you can find a variety of extensions available for WooCommerce <a href="%2$s" target="_blank">here</a>.'=>'Если вы хотите предложить <span class="help_tip" data-tip="%1$s">текущие тарифы</span> от конкретной транспортной компании (например, UPS), доступные расширения для WooCommerce см. <a href="%2$s" target="_blank">здесь</a>.','ShipStation'=>'ShipStation','ShipStation icon'=>'Значок ShipStation','Set up Stripe for me using this email:'=>'Установите Stripe для меня, используя этот адрес электронной почты:','WooCommerce PayPal Checkout Gateway'=>'Шлюз оформления заказа WooCommerce PayPal','Set up PayPal for me using this email:'=>'Установите PayPal для меня, используя этот адрес электронной почты:','When handling an %s, should access to downloadable files be revoked and download logs cleared?'=>'При обработке %s, должен ли доступ к скачиваемым файлам быть закрыт, а журналы скачивания очищены?','When handling an %s, should personal data within orders be retained or removed?'=>'При обработке %s, должны ли персональные данные по заказам быть сохранены или удалены?','We\'ll use %1$s for product weight and %2$s for product dimensions.'=>'Использовать %1$s для массы товара и %2$s для габаритов.','This is the attachment ID, or image URL, used for placeholder images in the product catalog. Products with no image will use this.'=>'Это ID вложения или URL изображения, используемый для заполнителей в каталоге продукции. Они будут использоваться для товаров без изображения.','We\'ve created two Shipping Zones - for %s and for the rest of the world. Below you can set Flat Rate shipping costs for these Zones or offer Free Shipping.'=>'Мы создали две зоны доставки - только %s и 