=>'Граммы','Meters'=>'Метры','Millimeters'=>'Миллиметры','Inches'=>'Дюймы','Yards'=>'Ярды','Ounces'=>'Унции','Sud Sardegna'=>'Южная Сардиния','Are you sure you want to remove the selected items?'=>'Вы уверены, что хотите удалить выбранные пункты?','You may need to manually restore the item\'s stock.'=>'Вам может потребоваться вручную восстановить количество по этой позиции на складе.','%d API key permanently revoked.'=>'%d ключ API отозван без возможности восстановления.' . "\0" . '%d ключа API отозваны без возможности восстановления.' . "\0" . '%d ключей API отозваны без возможности восстановления.','Apartment, suite, unit, etc.'=>'Крыло, подъезд, этаж и т.д.','This action cannot be reversed. Are you sure you wish to erase personal data from the selected orders?'=>'Это действие не может быть отменено. Вы уверены, что хотите удалить персональные данные из выбранных заказов?','Cannot set attributes due to invalid parent product.'=>'Нельзя установить атрибуты из-за неверного родительского товара.','shipping packagesShipping %d'=>'Доставка %d','Shipping Address'=>'Адрес доставки','Billing Address'=>'Платёжный адрес','Shipping Address 1'=>'Адрес доставки 1','Billing Address 1'=>'Платёжный адрес 1','Your CSV needs to include columns in a specific order. %1$sClick here to download a sample%2$s.'=>'Ваш CSV должен включать столбцы в определенном порядке. %1$sНажмите для загрузки примера%2$s.','Payer first name'=>'Имя плательщика','Payer last name'=>'Фамилия плательщика','Payer PayPal address'=>'Адрес PayPal плательщика','MySQL version string.'=>'Строка версии MySQL.','terms and conditions'=>'правила и условия','privacy policy'=>'политика конфиденциальности','United States (US) dollar'=>'Доллар США','PayPal allows us to send one address. If you are using PayPal for shipping labels you may prefer to send the shipping address rather than billing. Turning this option off may prevent PayPal Seller protection from applying.'=>'PayPal позволяет нам отправить один адрес Если вы используете PayPal для транспортной маркировки, возможно, предпочтительнее будет отправить адрес доставки, а не выставления счёта. При отключении этой опции Программа защиты продавцов PayPal может быть неприменима.','If you have a coupon code, please apply it below.'=>'Если у вас есть код купона, укажите его ниже.','This will be how your name will be displayed in the account section and in reviews'=>'Так ваше имя будет отображаться в разделе аккаунта и при публикации отзывов','eCheck ending in %1$s'=>'eCheck заканчивается на %1$s','%s field'=>'%s поле','PayPal Standard redirects customers to PayPal to enter their payment information.'=>'PayPal Standard перенаправляет клиентов на PayPal для ввода платёжных реквизитов.','Other locations'=>'Другие местоположения','Comma-separated list of search stopwords in your languageabout,an,are,as,at,be,by,com,for,from,how,in,is,it,of,on,or,that,the,this,to,was,what,when,where,who,will,with,www'=>'а,бы,быть,в,вам,вас,во,вы,до,его,её,же,за,и,из,или,к,как,ко,меня,моё,мой,мы,на,нам,наш,не,но,о,об,он,она,от,по,при,с,так,ты,у,уже,что,чтобы,это,я','No page set'=>'Страница не указана','Highlight required fields with an asterisk'=>'Выделить обязательные поля звёздочкой','These options let you change the appearance of the WooCommerce checkout.'=>'Эти функции позволяют изменить внешний вид страницы оформления заказа WooCommerce.','%1$s (#%2$s)'=>'%1$s (#%2$s)','Log PayPal events, such as IPN requests, inside %s Note: this may log personal information. We recommend using this for debugging purposes only and deleting the logs when finished.'=>'Создание журналов событий PayPal, таких как запросы мгновенных платежных уведомлений (IPN), в %s Примечание: при этом в журнал может быть внесена конфиденциальная информация. Рекомендуется использовать эту функцию только в целях отладки и по её завершении удалять файлы журналов.','%s page'=>'Стр. %s','Required'=>'Обязательно','Take payments in person via checks. This offline gateway can also be useful to test purchases.'=>'Принимать платежи лично посредством чеков. Данный автономный шлюз можно использовать для тестовых покупок.','Optionally add some text for the terms checkbox that customers must accept.'=>'При необходимости добавьте текст, который клиенты должны принять, поставив галочку.','Please see the <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">PayPal Privacy Policy</a> for more details.'=>'Дополнительная информация в <a href="https://www.paypal.com/us/webapps/mpp/ua/privacy-full">Политике конфиденциальности PayPal</a>.','We accept payments through PayPal. When processing payments, some of your data will be passed to PayPal, including information required to process or support the payment, such as the purchase total and billing information.'=>'Мы принимаем платежи через PayPal. При обработке платежа некоторые ваши данные передаются в PayPal. К ним относится информация, необходимая для обработки или выполнения платежа, например сведения об общей стоимости покупки и платёжные реквизиты.','Account details:'=>'Данные аккаунта:','%1$s &ndash; %2$s'=>'%1$s &ndash; %2$s','I have read and agree to the website %s'=>'Я прочитал(а) и принимаю %s сайта','Any &quot;%1$s&quot; method'=>'Любой способ «%1$s»','Take payments in person via BACS. More commonly known as direct bank/wire transfer.'=>'Принимать платежи лично посредством прямого банковского перевода (BACS).','In this subsection you should list which third party payment processors you’re using to take payments on your store since these may handle customer data. We’ve included PayPal as an example, but you should remove this if you’re not using PayPal.'=>'В этом разделе вам необходимо указать, услугами каких сторонних платёжных сервисов вы пользуетесь для приёма платежей в своем магазине, так как эти сервисы могут обрабатывать данные покупателей. Мы привели сведения об использовании PayPal в качестве примера. Если вы не пользуетесь услугами PayPal, этот текст необходимо удалить.','In this section you should list who you’re sharing data with, and for what purpose. This could include, but may not be limited to, analytics, marketing, payment gateways, shipping providers, and third party embeds.'=>'В этом разделе необходимо перечислить третьи стороны, которым вы передаёте информацию, указав, с какой целью вы это делаете. К таким целям может относиться, например, анализ данных, маркетинг, обеспечение работы платёжных шлюзов и встроенных объектов сторонних разработчиков.','We share information with third parties who help us provide our orders and store services to you; for example --'=>'Мы делимся информацией с третьими лицами, которые помогают нам предоставлять вам наши заказы и услуги магазина; например -','Order information like what was purchased, when it was purchased and where it should be sent, and'=>'Сведения о заказе: название купленного товара, время покупки и адрес доставки, а также','We will also store comments or reviews, if you choose to leave them.'=>'Также мы храним ваши комментарии и отзывы на товары.','Who on our team has access'=>'У каких членов команды магазина есть доступ','Members of our team have access to the information you provide us. For example, both Administrators and Shop Managers can access:'=>'Члены нашей команды имеют доступ к информации, которую вы нам предоставляете. Так, и администраторы, и менеджеры магазина имеют доступ к следующим данным:','We generally store information about you for as long as we need the information for the purposes for which we collect and use it, and we are not legally required to continue to keep it. For example, we will store order information for XXX years for tax and accounting purposes. This includes your name, email address and billing and shipping addresses.'=>'Обычно мы храним данные о вас столько, сколько необходимо для целей, ради которых мы их собираем и используем. Исключение составляют случаи, когда мы обязаны продолжать хранить эту информацию в связи с требованиями законодательства. Так, информация о заказе хранится у нас на протяжении XX лет, согласно правилам налогообложения и бухгалтерского учёта. К этим сведениям относится ваше имя, адрес электронной почты, адрес выставления счёта и адрес доставки.','Customer information like your name, email address, and billing and shipping information.'=>'Сведения о покупателе, к которым относятся ваше имя, адрес электронной почты, платёжные реквизиты и информация, связанная с доставкой.','Our team members have access to this information to help fulfill orders, process refunds and support you.'=>'Нашей команде необходим доступ к этой информации, чтобы выполнять ваши заказы и, при необходимости, возвращать средства и оказывать услуги поддержки.','What we share with others'=>'Какие данные мы передаём третьим сторонам','When you purchase from us, we’ll ask you to provide information including your name, billing address, shipping address, email address, phone number, credit card/payment details and optional account information like username and password. We’ll use this information for purposes, such as, to:'=>'Если вы захотите совершить у нас покупку, от вас потребуется предоставить сведения, включая ваше имя, адрес выставления счетов, адрес доставки, адрес электронной почты, номер телефона, данные банковской карты или платёжные реквизиты, а также дополнительные сведения аккаунта, такие как имя пользователя и пароль. Мы используем эти сведения в следующих целях:','If you create an account, we will store your name, address, email and phone number, which will be used to populate the checkout for future orders.'=>'Когда вы создаёте аккаунт, мы сохраняем ваше имя, адрес, Email и телефон для автоматического заполнения формы при оформлении заказов в будущем.','Improve our store offerings'=>'Улучшите предложения нашего магазина','Set up your account for our store'=>'Создайте свою учётную запись в нашем магазине','Send you information about your account and order'=>'Отправлять вам информацию о вашей учётной записи и заказе','Respond to your requests, including refunds and complaints'=>'Отвечать на ваши запросы, включая возвраты и жалобы','Process payments and prevent fraud'=>'Обрабатывать платежи и предотвращать мошенничества','Comply with any legal obligations we have, such as calculating taxes'=>'Соблюдать любые наши юридические обязательства, например расчёт налогов','Send you marketing messages, if you choose to receive them'=>'Отправлять маркетинговые сообщения, если вы решите их получать','We’ll also use cookies to keep track of cart contents while you’re browsing our site.'=>'Также мы используем cookie для отслеживания того, что вы кладёте в корзину, пока находитесь на нашем сайте.','Note: you may want to further detail your cookie policy, and link to that section from here.'=>'Примечание: возможно, вам стоит подробно описать свою политику в отношении cookie и разместить здесь ссылку на неё.','Shipping address: we’ll ask you to enter this so we can, for instance, estimate shipping before you place an order, and send you the order!'=>'Адрес доставки: он используется для оценки стоимость доставки до момента размещения заказа и отправки вам заказанных товаров!','Location, IP address and browser type: we’ll use this for purposes like estimating taxes and shipping'=>'Местоположение, IP и тип браузера: мы используем эти сведения для расчёта налогов и стоимости доставки','Products you’ve viewed: we’ll use this to, for example, show you products you’ve recently viewed'=>'Просмотренные вами товары: эти данные сохраняются, чтобы вы легко могли вернуться к товарам, которыми вы недавно интересовались','What we collect and store'=>'Какие данные мы собираем и храним','We collect information about you during the checkout process on our store.'=>'При оформлении заказа в нашем магазине мы собираем некоторые данные о вас.','While you visit our site, we’ll track:'=>'Когда вы посещаете наш сайт, мы сохраняем следующие сведения о вас:','This sample language includes the basics around what personal 