lect shipping methods'=>'Выберите способы доставки','Accept for virtual orders'=>'Принять для виртуальных заказов','Accept COD if the order is virtual'=>'Разрешить оплату наложенным платежом для виртуальных заказов','Payment to be made upon delivery.'=>'Оплата по факту доставки.','Proceed to PayPal'=>'Дальше на PayPal','PayPal'=>'PayPal','What is PayPal?'=>'Что такое PayPal?','Validation error: PayPal currencies do not match (code %s).'=>'Ошибка проверки: валюты в PayPal не совпадают (код %s).','Validation error: PayPal IPN response from a different email address (%s).'=>'Ошибка подтверждения: ответ PayPal IPN от другого адреса email (%s).','IPN payment completed'=>'IPN-оплата проведена','Validation error: PayPal amounts do not match (amt %s).'=>'Ошибка проверки: суммы в PayPal не совпадают (количество %s).','PDT payment completed'=>'PDT-оплата проведена','Enable PayPal Standard'=>'Включить PayPal стандарт','This controls the description which the user sees during checkout.'=>'Описание, которое видит пользователь при оформлении заказа.','PayPal email'=>'Email для PayPal','Please enter your PayPal email address; this is needed in order to take payment.'=>'Пожалуйста, введите свой PayPal email-адрес; это необходимо для совершения оплаты.','PayPal sandbox'=>'Песочница PayPal','Enable PayPal sandbox'=>'Включить песочницу PayPal','Debug log'=>'Журнал отладки','Enable logging'=>'Включить журналирование','Advanced options'=>'Дополнительные настройки','If your main PayPal email differs from the PayPal email entered above, input your main receiver email for your PayPal account here. This is used to validate IPN requests.'=>'Если ваш основной email PayPal отличается от введенного выше, то введите ваш основной получатель email здесь. Используется для подтверждения запросов IPN.','Please enter a prefix for your invoice numbers. If you use your PayPal account for multiple stores ensure this prefix is unique as PayPal will not allow orders with the same invoice number.'=>'Пожалуй